// Hardcoded dummy pdf file content, base64 encoded
const base64Content =
  // eslint-disable-next-line max-len
  '';

const base64ToBlob = async (base64: string, contentType: string): Promise<Blob> => {
  const base64DataUrl = `data:${contentType};base64,${base64}`;
  const result = await fetch(base64DataUrl);
  if (result.ok) {
    return result.blob();
  }
  throw new Error(`Could not fetch data url for base64 decoding: ${result.statusText}`);
};

/**
 * This is just for faking a generated pdf during dev/test.
 * Must never be used in production.
 */
export const fakePdf = async (): Promise<Blob> => {
  const blob = base64ToBlob(base64Content, 'application/pdf');
  return Promise.resolve(blob);
};
